import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}

export default function Header() {
  return (
    <div>
      <Link href="/">
      <Button variant="outlined" color="primary">
        <a style={linkStyle}>Home</a>
        </Button>
      </Link>
      <Link href="/about">
      <Button variant="outlined" color="primary">
        <a style={linkStyle}>About</a>
        </Button>
      </Link>
    </div>
  )
}
